import { Grid } from "@mui/material";

const Home = () => {
  return <>
    <Grid container justifyContent='center'>
      <Grid item sm={10}>
        <h1>Deep Insights</h1>
        <hr />
        <p> </p>
      </Grid>
    </Grid>
  </>;
};

export default Home;
